import React from 'react';
import './NewPost.scss';
import {TextField, Button, Typography, makeStyles, IconButton} from '@material-ui/core';
import CloseIcon from '@material-ui/icons/Close';

const useStyles = makeStyles ({
  disabledButton: {
    color: '#000020'
  },
  enabledButton: {
    color: '#000000'
  }
})

const NewPost = () => {
  const classes = useStyles();

  return (
    <div className="NewPostModal">
      <div class="IconWrapper"><IconButton
      aria-label="delete"
      color="secondary"
      size="medium">
        <CloseIcon />
      </IconButton></div>

      <img src="https://i.imgur.com/9wF1kZd.jpeg" class="UploadedImg"></img>

      <div class="TextWrapper">
      <Typography>Share more about this memory</Typography>
      </div>

      <div class="FieldWrapper"><TextField
      label="Your Name"
      fullWidth>
      </TextField></div>

      <div class="FieldWrapper"><TextField
      label="Your Comment"
      multiline
      fullWidth>
      </TextField></div>

      <div class="ButtonWrapper"><Button
      color="primary">
       SHARE
      </Button></div>
    </div> 
  )
}

export default NewPost;
